import GlobalConfig from "../GlobalConfig";

export const contactForm = (data = {}) => ({
  method: "POST",
  headers: GlobalConfig.getHeaders(["JSON"]),
  url: GlobalConfig.getApiUrlFromRoot("/contact-us"),
  data: { ...data }
});
